import React from "react";
import { createRoot } from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import { AuthProvider } from "./context/AuthContext"; // ✅ مهم
import { AllData } from "./Data/AllData";

import App from "./App";
import AllAbout from "./About/AllAbout";
import AllMenu from "./Menu/AllMenu";
import AllTestimonials from "./Testimonials/AllTestimonials";
import AllContact from "./Contact/AllContact";

import ReservationsDashboard from "./Dashboard/ReservationsDashboard";
import Dashboard from "./pages/Dashboard";

import Login from "./pages/Login";
import Register from "./pages/Register";
import { PrivateRoute } from "./components/PrivateRoute";

createRoot(document.getElementById("root")).render(
  <AllData>
    <BrowserRouter>
      <Routes>
        {/* Public Routes */}
        <Route path="/" element={<App />} />
        <Route path="/about" element={<AllAbout />} />
        <Route path="/menu" element={<AllMenu />} />
        <Route path="/testimonials" element={<AllTestimonials />} />
        <Route path="/contact" element={<AllContact />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* Private Routes */}
        <Route
          path="/dashboard"
          element={
            <PrivateRoute>
              <Dashboard />
            </PrivateRoute>
          }
        >
          <Route path="reservations" element={<ReservationsDashboard />} />
        </Route>
      </Routes>
    </BrowserRouter>
  </AllData>
);
